export function Name() { return "Nollie"; } 
export function VendorId() { return 0x16D2; }
export function ProductId() { return 0x1615; }
export function Publisher() { return "Nollie"; } 
export function Size() { return [1, 1]; }
export function DefaultPosition(){return [0, 0];}
export function DefaultScale(){return 1.0;}
export function Type() { return "Hid"; }

export function ControllableParameters() 
{
	return [
		{"property":"shutdownColor", "label":"Shutdown Color", "min":"0", "max":"360", "type":"color", "default":"000000"},
		{"property":"LightingMode", "label":"Lighting Mode", "type":"combobox", "values":["Canvas", "Forced"], "default":"Canvas"},
		{"property":"forcedColor", "label":"Forced Color", "min":"0", "max":"360", "type":"color", "default":"009bde"},
		{"property":"Electric", "group":"lighting", "label":"Acquired current", "type":"boolean", "default": "false"}
	];
}

const DeviceMaxLedLimit = 600;
const MaxLedsInPacket = 21;
let frequency = 0;
let ChannelArray = 
[
	["Channel 09", 525],
	["Channel 10", 525],
	["Channel 11", 525],
	["Channel 12", 525],
	["Channel 13", 525],
	["Channel 14", 525],
	["Channel 15", 525],
	["Channel 16", 525]
	
];


function SetupChannels()
{
	device.SetLedLimit(DeviceMaxLedLimit);

	for(let i = 0; i < ChannelArray.length; i++)
	{
		device.addChannel(ChannelArray[i][0], ChannelArray[i][1]);
	}
}

export function Initialize() 
{
	SetupChannels();
	let RGBData = [];
	RGBData = device.createColorArray(shutdownColor, 1, "Inline");	
	let packet = [0x00,0xfe,0x01,RGBData[0],RGBData[1],RGBData[2]];
	device.write(packet, 65);
	device.pause(1);
}

function Read_Electric()
{
	var packet = new Array(65).fill(0);
	packet[1] = 0xfd;
	device.flush();
	device.write(packet, 65);
	var config = device.read(packet, 65);
	const intValue = ((config[2] << 8) | config[3])/100;
	device.log("Electric current:"+ intValue + "A" + "   Power:" + (intValue * 5).toFixed(2) + "W" + "   brightness:" + "-" + config[1]);
}

export function Render() 
{
	for(let i = 0; i < ChannelArray.length; i++)
	{
		
		SendChannel(i);
	}

	let packet = [0x00,0xff];
	device.write(packet, 65);
	if(Electric)//read Electric
	{
		frequency += 1;
		if(frequency > 30)
		{
			frequency = 0;
			Read_Electric();
		}

	} 

	
}



export function Shutdown() 
{
	for(let i = 0; i < ChannelArray.length; i++)
	{
		SendChannel(i, true);
	}
	let packet = [0x00,0xff];
	device.write(packet, 65);  
	let RGBData = [];
	RGBData = device.createColorArray(shutdownColor, 1, "Inline");	
	let packet1 = [0x00,0xfe,0x01,RGBData[0],RGBData[1],RGBData[2]];
	device.write(packet1, 65);
	device.pause(1);
}

function SendChannel(Channel, shutdown = false) 
{

	let ChannelLedCount = device.channel(ChannelArray[Channel][0]).ledCount > ChannelArray[Channel][1] ? ChannelArray[Channel][1] : device.channel(ChannelArray[Channel][0]).ledCount;
	let componentChannel = device.channel(ChannelArray[Channel][0]); 

	
	let RGBData = [];

	if(shutdown)
	{

		RGBData = device.createColorArray(shutdownColor, ChannelLedCount, "Inline");
		
	}
	else if(LightingMode === "Forced") 
	{
		
		RGBData = device.createColorArray(forcedColor, ChannelLedCount, "Inline");
	}
	else if(componentChannel.shouldPulseColors()) 
	{
		ChannelLedCount = 100;
		
		let pulseColor = device.getChannelPulseColor(ChannelArray[Channel][0], ChannelLedCount);
		RGBData = device.createColorArray(pulseColor, ChannelLedCount, "Inline");
	}
	else
	{
		
		RGBData = device.channel(ChannelArray[Channel][0]).getColors("Inline");
		
		
	}

	let NumPackets = Math.ceil(ChannelLedCount / MaxLedsInPacket); 
 	
	for(let CurrPacket = 0; CurrPacket < NumPackets; CurrPacket++)
	{
		let packet = [0x00, CurrPacket+Channel*25];

		packet.push(...RGBData.splice(0, 63));

		device.write(packet, 65);
	}
}

export function Validate(endpoint)
{
	return endpoint.interface === 2;
}

export function Image()
{
	return "";
}